export default function About() {
  return (
    <main id="main">
      <h1 id="welcome">Kamusta? Welcome to my portfolio!</h1>
      <p id="name">Hi! I am Mary Louise Abrena!</p>
      <p id="intro">I am a Backend Developer and I'm
        continously learning different tech language at Humber College. Most of
        my experiences are based on my projects and assignments, grassroot
        organizations and my passion projects.
      </p>
    </main>
  );
}
